description:
This non-narrative film unveils three episodes in the psychosexual life of a neurotic man, beginning with a trip he took to the countryside over the holidays as a small boy, to visit a cousin. Later, he is shown as a high-school boy (Mads Ole Erhadsen). Finally, he is shown as a young man, busily engaged in the amorous pursuit of a trainee nurse. - Clarke Fountain, All Movie Guide
